import React from 'react';

import { TextField } from "@material-ui/core";

export const Form = () => {

  return (
    <form noValidate autoComplete="off">
      <div className="">
        <TextField
          required
          label="Name"
          helperText="Some important text"
          variant="outlined"
        />
        <TextField
          label="Password"
          type="password"
          autoComplete="current-password"
          variant="outlined"
        />
      </div>
    </form>
  );
};
